webpackJsonp([0xaa40e3b97c20],{1173:function(e,a){e.exports={data:{markdownRemark:{html:'<p>As readers of this blog may know, my Go Design Something idea has a long and storied history. It began life as <a href="/blog/less-talk-more-practice-instructional-design-communities-of-practice/">AWSMPrompts</a>, way back in February of 2015. I took some feedback on making the prompts more specific and tried again with Go Design Something.co with much more specific challenges. I tried that from May to December, but I still didn’t get much traction. Then, I got super inspired and tried to emulate a great brief site for designers (not IDs) called BriefBox in July of this year. And I got a <a href="/blog/go-design-something-challenges/">cease and desist letter</a>. So… I wasn’t sure what to do. Just this month, I finally finished my Free Code Camp Front End certificate (YAY!!!) and I was looking at my Trello boards of project ideas. And it hit me: I could take an old project idea that has just been sitting there, mix it with my abandoned project idea, and create a mini-project. Something much smaller, much less ambitious, but still in the same vein (remember Start small, Start now).</p>\n<figure>\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 810px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 46.62491301322199%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/png;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="Trello card describing scenario generator" title="" src="/static/Screen-Shot-2016-12-26-at-12.32.26-PM-abda8211bc7c06dbc30b0e198f478789-1626e.png" srcset="/static/Screen-Shot-2016-12-26-at-12.32.26-PM-abda8211bc7c06dbc30b0e198f478789-076ec.png 203w,\n/static/Screen-Shot-2016-12-26-at-12.32.26-PM-abda8211bc7c06dbc30b0e198f478789-7ae34.png 405w,\n/static/Screen-Shot-2016-12-26-at-12.32.26-PM-abda8211bc7c06dbc30b0e198f478789-1626e.png 810w,\n/static/Screen-Shot-2016-12-26-at-12.32.26-PM-abda8211bc7c06dbc30b0e198f478789-9af38.png 1215w,\n/static/Screen-Shot-2016-12-26-at-12.32.26-PM-abda8211bc7c06dbc30b0e198f478789-03d88.png 1620w,\n/static/Screen-Shot-2016-12-26-at-12.32.26-PM-abda8211bc7c06dbc30b0e198f478789-ca085.png 2430w,\n/static/Screen-Shot-2016-12-26-at-12.32.26-PM-abda8211bc7c06dbc30b0e198f478789-584db.png 2874w" sizes="(max-width: 810px) 100vw, 810px">\n    </span>\n  </span>\n  \n  <figcaption>I mixed this...</figcaption>\n</figure>\n<figure>\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 810px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 49.30362116991643%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/png;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="Trello card describing brief site for IDs" title="" src="/static/Screen-Shot-2016-12-26-at-12.33.19-PM-c88669048d27a28d3e00ca0c2b4c69b3-1626e.png" srcset="/static/Screen-Shot-2016-12-26-at-12.33.19-PM-c88669048d27a28d3e00ca0c2b4c69b3-076ec.png 203w,\n/static/Screen-Shot-2016-12-26-at-12.33.19-PM-c88669048d27a28d3e00ca0c2b4c69b3-7ae34.png 405w,\n/static/Screen-Shot-2016-12-26-at-12.33.19-PM-c88669048d27a28d3e00ca0c2b4c69b3-1626e.png 810w,\n/static/Screen-Shot-2016-12-26-at-12.33.19-PM-c88669048d27a28d3e00ca0c2b4c69b3-9af38.png 1215w,\n/static/Screen-Shot-2016-12-26-at-12.33.19-PM-c88669048d27a28d3e00ca0c2b4c69b3-03d88.png 1620w,\n/static/Screen-Shot-2016-12-26-at-12.33.19-PM-c88669048d27a28d3e00ca0c2b4c69b3-ca085.png 2430w,\n/static/Screen-Shot-2016-12-26-at-12.33.19-PM-c88669048d27a28d3e00ca0c2b4c69b3-1113d.png 2872w" sizes="(max-width: 810px) 100vw, 810px">\n    </span>\n  </span>\n  \n  <figcaption>... With this!</figcaption>\n</figure>\n<p>And so, a new incarnation of <a href="http://godesignsomething.co/">GoDesignSomething.co</a> was born! Using the Bootstrap Framework and Angular JS, I created a project idea generator that I encourage everyone to use! (I think I’ll update the copyright to a creative commons license very soon). The new site currently feature 19 short project briefs, each sanitized from real ID projects across the ID spectrum, such as elearning, script writing, video creation, and systems planning/design. Each brief includes:</p>\n<ul>\n<li>Intended audience</li>\n<li>Context of the project</li>\n<li>Expected deliverables (what you should actually make)</li>\n<li>Links to diverse sources of inspiration</li>\n</ul>\n<p>I’d love your input on the site and anything you think would serve you better! I’d also really love to have more sanitized briefs from the community. It’s super helpful to have realistic projects for new IDs to get some idea of the real work that IDs do in the world. There’s a <a href="https://goo.gl/forms/8OjBfa4IOn4Uy7TD2">handy, dandy Google Form where you can submit a project idea</a>. Let me know what you think!</p>',frontmatter:{date:"December 27, 2016",path:"/blog/go-design-something-the-final-incarnation",title:"Go Design Something: The Final Incarnation?",tags:["coding","portfolio work","project ideas"],categories:["Coding","GDS Challenge","Inspiration"],featured:{childImageSharp:{sizes:{base64:"data:image/png;base64,",aspectRatio:2.0268361581920904,src:"/static/Screen-Shot-2016-12-26-at-11.30.09-AM-056ddcd6716c1932d76002f2b8c0124c-81d39.png",srcSet:"/static/Screen-Shot-2016-12-26-at-11.30.09-AM-056ddcd6716c1932d76002f2b8c0124c-9a8d1.png 203w,\n/static/Screen-Shot-2016-12-26-at-11.30.09-AM-056ddcd6716c1932d76002f2b8c0124c-c53f9.png 405w,\n/static/Screen-Shot-2016-12-26-at-11.30.09-AM-056ddcd6716c1932d76002f2b8c0124c-81d39.png 810w,\n/static/Screen-Shot-2016-12-26-at-11.30.09-AM-056ddcd6716c1932d76002f2b8c0124c-e460a.png 1215w,\n/static/Screen-Shot-2016-12-26-at-11.30.09-AM-056ddcd6716c1932d76002f2b8c0124c-3ae57.png 1620w,\n/static/Screen-Shot-2016-12-26-at-11.30.09-AM-056ddcd6716c1932d76002f2b8c0124c-12a27.png 2430w,\n/static/Screen-Shot-2016-12-26-at-11.30.09-AM-056ddcd6716c1932d76002f2b8c0124c-a9eec.png 2870w",sizes:"(max-width: 810px) 100vw, 810px"}}}}}},pathContext:{}}}});
